          I can say fuck, right? Good, because I don't give a kcuf like the F word reversed.<br /><br />Enough with nonsense, let's start with some cents. Two dollars and thirty-eight cents in my pocket, which is pretty damn sad. That's only 4.76 games of Street Fighter at the local arcade. Paycheck on Tuesday = Picking up a copy of Legend of Zelda the Four Swords for GCN. But, what's even better than my paycheck will be the <a href="http://www.heathenrock.tk">show</a> on the 12th. Ahh yes, we haven't played a show in weeks. It should be good. A crowded little basement show to lift the spirits.<br /><br />Hey, anybody here like ice-pops? Those have become an addiction, damn their artificially flavored goodness. They go good with hot days. You people should check out the <a href="http://10x.dform.org">Tenfold</a> website. It features music by Joe and I, but he hasn't bothered to post any of his music yet, what a skag.<br /><br />Hey <b>Village Idiot</b>, you may be a Star Wars geek and all, but I think I may steal your position as head geek around here. I don't play D&D or anything like that, but I play a mean game of Street Fighter...and *cough*DDR*cough* Man, I'm almost ashamed to say it, but DDR is so fun. For all those who haven't tried it because it looks scary as hell, just try it once. You'll be sucked into a vortex of scrolling arrows and sappy techno music (a good thing). My girlfriend bought the game and two dance pads and we've been assimilated into the world of DDR ever since. And on that note...<br /><br />Astalamaleka.<br />
